from lib import *
from crud import *             #import all modules from crud.py
from pandadf import *          #import all modules from pandadf.py
#~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
#MAIN PYTHON CODE STARTS HERE
#~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
def main():
    sg.change_look_and_feel('Dark Blue 3')

    the_submit_icon = b''
    the_exit_icon = b''
    one_menu = b''
    two_menu = b''
    three_menu = b''
    four_menu = b''
    five_menu = b''
    six_menu = b''
    seven_menu = b''
    eight_menu = b''
    nine_menu = b''

    layout = [[sg.Text('MAIN MENU', size=(30,1), font=('Caviar', 20))],
        [sg.Button('', image_data=one_menu, border_width=0, image_subsample=1, key='1 -Show all books')],
        [sg.Button('', image_data=two_menu, border_width=0, image_subsample=1, key='2 -Search for book')],
        [sg.Button('', image_data=three_menu, border_width=0, image_subsample=1, key='3 -Edit a book')],
        [sg.Button('', image_data=four_menu, border_width=0, image_subsample=1, key='4 -Create a book')],
        [sg.Button('', image_data=five_menu, border_width=0, image_subsample=1, key='5 -Delete a book')],
        [sg.Text('CHARTS/VISUALIZATIONS', size=(30,1), font=('Caviar', 20))],
        [sg.Button('', image_data=six_menu, border_width=0, image_subsample=1, key='6 -Show Genre Frequency')],
        [sg.Button('', image_data=seven_menu, border_width=0, image_subsample=1, key='7 -Show Publish Year Frequency')],
        [sg.Button('', image_data=eight_menu, border_width=0, image_subsample=1, key='8 -Show Publish Year Frequency by Genre')],
        [sg.Button('', image_data=nine_menu, border_width=0, image_subsample=1, key='9 -Show Price/Values by Publish Year')],
        [sg.Text('Choose an option or press x to exit.')],
        [sg.Button('', image_data=the_exit_icon, border_width=0, image_subsample=3, key='EXIT')]]

    window = sg.Window('Programming Books Database', layout, no_titlebar=False, font=("Caviar", 15))

    # event loop allows a user to keep selecting more menu options till they exit
    while True:
        event, values = window.read()

        if event == 'EXIT':
            break

        if event == '1 -Show all books':
            showAllBooks()

        if event == '2 -Search for book':
            searchForBook()

        if event == '3 -Edit a book':
            editBook()

        if event == '4 -Create a book':
            createBook()

        if event == '5 -Delete a book':
            deleteBook()

        if event == '6 -Show Genre Frequency':
            window.Hide()
            genreBarChart()
            window.UnHide()

        if event == '7 -Show Publish Year Frequency':
            publishyearBarChart()

        if event == '8 -Show Publish Year Frequency by Genre':
            publishdateScatter()

        if event == '9 -Show Price/Values by Publish Year':
            pricepublish()

    window.close() # close the main window
    quit() # quit the program

if __name__ == '__main__':
	main()

